import React from 'react'
import Container from '@material-ui/core/Container'
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import { getAll } from '../services/cargo.service';

export default _ => {

	let cargo;

	getAll().then(response => { 
		cargo = response.data;
		console.log('resposta',response.data)
	})

	function getCargo(){
		return cargo || 'Não existe cargo';
	}

	return (
		<div>
			<AppBar position="relative">
        		<Toolbar>
          			<Typography variant="h6" color="inherit" noWrap>
            			SGU
          			</Typography>
        		</Toolbar>
      		</AppBar>
			<AppBar position="static" color="default" elevation={0}>
        		<Toolbar>
          			<Typography variant>
            			SGU
          			</Typography>
          			<nav>
            			<Link variant="button" color="textPrimary" href="/cargos/todos">
              				Cargos
            			</Link>
            			<Link variant="button" color="textPrimary" href="/perfis/todos">
              				Perfis
            			</Link>
            			<Link variant="button" color="textPrimary" href="usuarios/todos">
              				Usuários
            			</Link>
          			</nav>
        		</Toolbar>
      		</AppBar>
			<Container maxWidth="sm" component="main">
        		<Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
          			{ getCargo }
        		</Typography>
      		</Container>
	  	</div>
	)
}
